import React from "react";
import NavBar from "./NavBar";
import Banner from "./Banner";
import Original from "./Menu/Original";
import Card from "../../components/UI/Card";
import Trending from "./Menu/Trending";

function Browse() {
  return (
    <div>
      <NavBar />
      <Banner />
      <Card>
        <Original />
        <Trending />
        <Trending />
        <Trending />
        <Trending />
      </Card>
    </div>
  );
}

export default Browse;
